import React from 'react';
import photo  from '../img/photo.jpg';
import photo1  from '../img/photo-1.jpg';
import photo2  from '../img/photo-2.jpg';
import photo3  from '../img/photo-3.jpg';
export default function Gridgallery() {
  return (
    <div className='Container p-4'>
        <div className=' flex flex-col sm:flex-row md:space-x-2 gap-4 justify-between items-center my-12'>
          <div className='w-full md:w-1/4 shadow p-3 text-center'>
            <img className='h-40 w-full' src={photo} width={120} height={120} alt='Img'></img>
            <span className='block text-lg text-gray-600 font-semibold py-2'>Techology Service</span>
          </div>
          <div className='w-full md:w-1/4 shadow p-3 text-center'>
            <img className='h-40 w-full' src={photo1} width={120} height={120} alt='Img'></img>
            <span className='text-lg text-gray-600 font-semibold py-2'>Remote Support</span>
          </div>
          <div className='w-full md:w-1/4 shadow p-3 text-center'>
            <img className='h-40 w-full' src={photo2} width={120} height={120} alt='Img'></img>
            <span className='text-lg text-gray-600 font-semibold py-2'>24/7 open Call Center</span>
          </div>
          <div className='w-full md:w-1/4 shadow p-3 text-center'>
            <img className='h-40 w-full' src={photo3} width={120} height={120} alt='Img'></img>
            <span className='text-lg text-gray-600 font-semibold py-2'>Best Solution</span>
          </div>
        </div>
    </div>
  )
}
